import React, { Component } from 'react';
import './App.css';
import Login from './Pages/Login/Login'
import Main from './Pages/Main/Main'

class App extends Component {

  state = {
    loggedIn: false,
  }

  render() {
    return (

      <div className="App">
        {this.state.loggedIn
          ?
          <Login/>
          :
          <Main/>
        }
      </div>
    );
  }
}

export default App;
